import React, {Component} from 'react'

class Main extends Component {
    //Our React Code
    render() {
        return (
           <div id="content" className="mt-3">
               <table className="table text-muted text-centered">
                    <thead>
                   <tr style={{color:'white'}}>
                       <th></th>
                       <th></th>
                   </tr>
                   </thead>
                   <tbody>
                       <tr>
                           <td></td>
                           <td></td>
                       </tr>
                   </tbody>
               </table>
           </div>
        )
    }
}

export default Main;
